Today I had the distinct pleasure of reviewing the SWEENEY TODD scores with master orchestrator Jonathan Tunick. He still has his handwritten charts from 1979 — it’s a wonder to see them up close. The fact that I got to ask him questions about his writing process on a masterpiece makes this an afternoon I’ll never forget. 

s/o to @steph.l.evans for being there to document all the things we found!

